description:
Venturi adapter for an AquaClear 70 Powerhead.  Good air intake.  Tested on a 120 gallon system.

Notes:
- OpenSCAD file provided so that it can be customized and adapted for other powerheads;
- Tested over multiple versions for optimized air intake;
- Printed upside-down with minimal build plate support only on surfaces with less than 10% slope;
- Being used with the co2 reactor published in Thingiverse;
